import React from "react";
function Broker() {
  return ( 
      <div className="container">
        <div className="row p-5">
          <div className="col-8">
            <h4 style={{ color: "#3d7ac5ff" }}>Brokerage calculator</h4>
            <ul></ul>
          </div>
          <div className="col-4">
            <h4 style={{ color: "#528dd4ff" }}>List of charges</h4>
          </div>
        </div>
      </div>
   );
}

export default Broker;
